import React, { Component } from 'react';
import { Text } from 'react-native';

/**
 * 
 * @returns L'écran d'aide, contenant la documentation destinée à l'utilisateur.
 */
const Aide = () => {
    return(
        <Text>La section aide sera ici</Text>
    )
}

export default Aide
